e_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"287462","type":"CustomJS"},{"attributes":{"axis":{"id":"287419"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"287422","type":"Grid"},{"attributes":{"fill_color":{"field":"inc","transform":{"id":"287113"}},"hatch_color":{"field":"inc","transform":{"id":"287113"}},"line_color":{"field":"inc","transform":{"id":"287113"}},"top":{"field":"Volume"},"width":{"value":0.8},"x":{"field":"index"}},"id":"287350","type":"VBar"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwP7DVuTge4u8/CqxUu6Mp8D9WhQGpH+TvPzMxuIpnp+8/MTaWeIxH7z+GyWGii+7uP5aFYrPrU+8/z9f2f5hg7z+DXbGkc5XvP917D1O2eu8/CC/Xsp557z/XkTkU0jrvPxLzahqCpe8/smhNjBlj7z9vMBntxjnvPxjiiOILW+8/lyZY7XAs7z9lJtHTB8DuPwoNk519dO4/HcqwGb5f7j9zM8hTyQbuPxSy3wkwsu0/4V4GVBl17T9lDadk6oLtP2fyoZG1ee4/uccWN2rk7j+FBH
